pragma solidity >=0.4.0 <0.7.0;

contract OrganizationList {
    //user user signed relations are here
    struct DocumentList {
        uint256 userid;
        Document[] signedDocs;
    }
    struct Document {
        string url;
        uint256 oid;
        uint256 userId;
        string hasha;
    }
    struct Organization {
        string name;
        string secret;
    }
    struct User {
        string name;
        string secret;
    }

    //containers
    Document[] public issuedDocuments;
    Organization[] public organizations;
    User[] public users;

    //Other useful maps
    // to return corresponding index of a unique string in the array of organizations
    mapping(string => uint256) corresOrg;
    mapping(string => uint256) corresUser;
    mapping(string => uint256) corresDocument;

    //class methods

    function createOrganization(string memory name, string memory secret)
        public
    {
        Organization memory newOrg = Organization(name, secret);
        organizations.push(newOrg);
    }

    //Organization related functions
    function issueDocument(
        string memory url,
        string memory hasha,
        uint256 oid,
        uint256 userId,
        string memory orgsecret
    ) public  {
        Document memory newDoc = Document(url, oid, userId, hasha);
        issuedDocuments.push(newDoc);
    }

    function deleteDocument(uint256 index) public {
        issuedDocuments[index] = Document("null", 200, 200, "null");
    }

    //User related functions
    // uint is the user id, DocumentList is the list of documents he has signed
    DocumentList[] signedAgreement;

    function createUser(
        string memory name,
        string memory secret
    ) public {
         User memory newUser = User(name, secret);
         users.push(newUser);
    }
    function getOrganization() public view returns (uint256) {
        return organizations.length;
    }
    function getUser() public view returns (uint256) {
        return users.length;
    }
    function getIssueDocument() public view returns (uint256)
    {
        return issuedDocuments.length;
    }

    //document must already be issued before someone signs it
    function signDocument(string memory userId, uint256 docIndex) public {
        uint256 userIndex = corresUser[userId];
        signedAgreement[userIndex].signedDocs.push(issuedDocuments[docIndex]);
    }

    //General functions

    function verifyDocument(
        string memory url,
        uint256 oid,
        uint256 userId,
        uint256 docIndex,
        string memory _hash
    ) public returns (bool) {
        if (
            keccak256(bytes(issuedDocuments[docIndex].hasha)) !=
            keccak256(bytes(_hash)) ||
            keccak256(bytes(issuedDocuments[docIndex].url)) !=
            keccak256(bytes(url)) ||
            (issuedDocuments[docIndex].userId != userId) ||
            (issuedDocuments[docIndex].oid != oid)
        ) {
            return false;
        }
        return true;
    }
}
